import React, { useState } from "react";
import "./Css/restaurentDetailsCss.css"; // Make sure to import your CSS file

function BillAndMap() {
    let bill=[
        {
            item : "Product 1",
            price : "10.99 $"
        },
        {
            item : "Product 2",
            price : "3.99 $"
        },
        {
            item : "Product 3",
            price : "9.99 $"
        },
        {
            item : "Product 4",
            price : "25.99 $"
        }

    ]
  return (
    <div className="sub-section sub-sectionRestaurant-BillMap">
      <h2>Bill</h2>
      <table className="data-table">
        <tbody>
          <tr>
            <th className="column1">Items</th>
            <th className="column2">Price</th>
          </tr>
          <tr>
            <td className="column1">Product 1</td>
            <td className="column2">9.99</td>
          </tr>
          <tr>
            <td className="column1">Product 2</td>
            <td className="column2">9.99</td>
          </tr>
        </tbody>
      </table>
      <button className="table-button">Pay</button>

      <h5>Google Map</h5>
      <div className="google-map"></div>
    </div>
  );
}

export default BillAndMap;
